		<p class="case-study case-intro">In 2010, Joey Mucha parlayed his experience in the world of competitive skeeball into founding a skeeball rental company based in San Francisco called <a href="http://joey-the-cat.com">Joey The Cat</a>.</p>

		<p class="case-study case-secondary">The simple <a href="http://wordpress.org">WordPress</a> site the team put together in the early days got the job done, but Joey wanted their next website to position Joey The Cat in the sweet spot between "Dependable Professional" and "Life of the Party." When he reached out to us to talk about how we could work together, we were very excited to get the ball rolling.</p>

		<p class="case-study case-secondary">We started the project by gathering visuals of people playing their games and enjoying their events, and paired those with copy for the site that was punchy, easy to digest, and full of their trademark personality. As we iterated with JTC through the wireframing and design stages, we settled on a balance of the two that shows visitors everything they need to know at a glance, and then leads them to their next step toward becoming a customer.</p>

		<p class="case-study case-tertiary">Now that the new site is live, the Joey the Cat team takes tremendous pride in knowing that when someone visits their site the first time, the impression they make online is as great as the one they work so hard to make in person.</p>

